import React from 'react';
import Home from "./Home";
import dentists from "./utils"

export default function UserList ( {contacts} ){
    return(
        <div>
            {contacts.map((contact) => (
                <div key={contact.phone}>
                    <form>
                    <p>{contact.first_name}</p>
                    <p>{contact.last_name}</p>
                    <p>{contact.email}</p>
                    <p>{contact.phone}</p>
                    </form>
                    {dentists.map((dentist) =>
        <div key={dentist.phone}>
            <input type="text">{dentist.first_name}</input>
            <input type="text">{dentist.last_name}</input>
            <input type="text">{dentist.email}</input>
            <input type="text">{dentist.phone}</input>
        </div>)}
                </div>
            ))}
        </div>
    )
}
